        "Desc": "A young Tepetlisaurus with the ability to tunnel between rocks and solid phlogiston.\nThey have not yet formed the horns on their forehead, and their digging skills are still developing as well. It is even common to hear about young Tepetlisaurs getting trapped by rocks while practicing their digging. However, one day, they will grow into a form that may travel freely through even the toughest of soils.",
