        "Name": "Qucusaurus Chick",
        "Title": [
            "Qucusaurus Chick",
            "Ranging Saurians of Natlan"
        ],
        "Desc": "A young Qucusaur with a light, agile body.\nIts neck and wings have yet to fully develop, and it still has a long way to go before it can wield gaseous phlogiston. There are stories of older Qucusaurs pushing younglings off cliffs to encourage them to fly. While the truth of such tales is uncertain, as long as it keeps practicing day and night, there can be no doubt that the soft-feathered fledgling will eventually grow strong and resilient.",
