        "_id": 62401,
        "Name": "Iktomisaurus Chick",
        "Title": [
            "Iktomisaurus Chick",
            "Ranging Saurians of Natlan"
        ],
        "Desc": "A young Iktomisaur with a keen sense of perception.\nIt has yet to grow its full plumage and may even appear a little slow on the uptake. It is said that among the Saurians that now live, Iktomisaurs not only have the longest lifespans, but spend the longest time as juveniles too. They possess the capacity to communicate with the Night Kingdom or Wayob, though it may take many years before the young Saurians can fully comprehend this.",
