        "Name": "Close Combat Storm Landcruiser",
        "Title": [
            "Landcruiser",
            "Close Combat Storm"
        ],
        "Desc": "An autonomous machine that applies the principles of naval combat to land battles, a literal \"armed ship that cruises on land.\"\nEquipped with Crawler Track Movement Mechanisms, these Landcruisers are normally used to storm enemy positions, where they can pass over rough terrain such as mud and melting snow despite heavy armor and armaments through their excellent load-bearing capabilities and off-road mobility. When close-combat Landcruisers approach enemy defensive lines in formation, rotating blades raised for battle, most foes will concentrate fire on them, allowing other units the opportunity to unleash their firepower...",
