        "Name": "Force Recon Ground Effect Landcruiser",
        "Title": [
            "Landcruiser",
            "Force Recon Ground Effect"
        ],
        "Desc": "An autonomous machine that applies the principles of naval combat to land battles, a literal \"armed ship that cruises on land.\"\nThe ground effect Landcruiser is able to \"fly\" a certain distance above ground by maintaining lift and generating pressure differentials through firing high-speed jet sprays at the surface, allowing it to more economically achieve combat cruising speed, avoid mines and traps, and perform highly effective assaults. However, costs and limits on operation time mean that mass-produced models carry limited payloads. As such, they are currently limited to Force Recon roles...",
